import React from "react";
import {BrowserRouter as Router, Route, Link} from "react-router-dom";


function AppRouter() {
    return (
        <Router>
            <div>
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/about">About</Link>
                        </li>

                    </ul>
                </nav>

                <Route exact path="/" component = {Home} />
                <Route path="/about/" component = {About} />
            </div>
        </Router>
    );
}

function Home() {
    return <h2>Home</h2>
}

function About() {
    return <h2>About</h2>
}

export default AppRouter;
